    false,nt"url": null,nt"notes": "Landscape conservation cooperatives (LCCs)
    are conservation-science partnerships between the U.S. Fish and Wildlife Service,
    U.S. Geological Survey (USGS), and other federal agencies, states, tribes, NGOs,
    universities and stakeholders within a geographically defined area. They inform
    resource management decisions to address national-scale stressors-including habitat
